import React from "react";
import "./button-radio.css";
import {useForm} from "react-hook-form";


function ButtonRadio({title}){
    const { register } = useForm();
    return(
        <>
        <label htmlFor={title }>
<input type="radio" name={title} id={title}
       {...register({title})}/>
<div class="box">
    <span>{title}</span>
</div>
</label>

</>
)
}
export default ButtonRadio;
